import './App.css';


function App() {
  return (
    <table>
            <thead>
              <th>Modello</th>
            </thead>
            <tbody>
            <tr>
                <td>Mario</td>
                <td>Rossi</td>
                <td>35</td>
            </tr>
            <tr>
                <td>Giovanna</td>
                <td>Bianchi</td>
                <td>28</td>
            </tr>
            </tbody>
        </table> 
  );
}

export default App;
